  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113923 includes discrete
  sample, tows and biological data collected aboard the CHARTER/FISHING BOATS during
  cruises FR0206-01, FR0206-02, FR0208, SE0005 and SE0007 in the North Pacific Ocean
  from 2000-05-29 to 2002-08-17. These data include CHLOROPHYLL A and PHAEOPIGMENTS.
  The instruments used to collect these data include bottle. These data were collected
  by Suzan Pool of Oregon State University and Richard Brodeur of National Oceanic
  and Atmospheric Administration as part of NEP. The Biological and Chemical Oceanography
  Data Management Office (BCO-DMO) submitted these data to NODC on 2013-09-28.nnThe
  following is the text of the abstract provided by BCO-DMO:nnU.S. GLOBEC Northeast
  Pacific, California Current SystemnMesoscale Process Studies Chlorophyll a DatanDuring
  juvenile salmonid trawling cruises, additional sampling included CTD profiles, neuston
  net tows, and chlorophyll a water samples. At most stations, data on all parameters
  were collected.nContacts for this data set are:nDr. Richard BrodeurnNorthwest Fisheries
  Science CenternNational Oceanographic and Atmospheric AdministrationnNewport, OR
  97365nPhone: 541-867-0336nEmail: rick.brodeur@noaa.govnSuzan PoolnCooperative Institute
